import {Route, Routes} from 'react-router-dom';
import {useContext} from 'react';
import AppContext from './provider/Context';

function App() {
  const {todos} = useContext(AppContext);
  console.log(todos);

  return (
    <div className="container">
     {
      todos.map((todo,index)=>(
        <div>
          <p>{todo.id}</p>
          <p>{todo.title}</p>
          <p>{todo.completed}</p>
        </div>
      ))
     }
    </div>
  );
}

export default App;
